import React from 'react';
import { useParams, useNavigate } from 'react-router-dom';

const BookingPage = (props) => {
    const navigate = useNavigate();
    const { restaurantName } = useParams();
    const validateForm = (e) => {
        e.preventDefault();
        const nameInput = document.getElementById('data_3');
        const emailInput = document.getElementById('data_5');
        const dateInput = document.getElementById('data_6');
        const timeInput = document.getElementById('data_7');

        if (isEmpty(nameInput.value.trim())) {
            alert('Name is required!');
            return false;
        }
        if (!validateEmail(emailInput.value.trim())) {
            alert('Email must be a valid email address!');
            return false;
        }
        if (isEmpty(dateInput.value.trim())) {
            alert('Date is required!');
            return false;
        }
        if (isEmpty(timeInput.value.trim())) {
            alert('Time is required!');
            return false;
        }
        return true;
    };

    const isEmpty = (str) => {
        return str.length === 0 || !str.trim();
    };

    const validateEmail = (email) => {
        const re = /^([\w-]+(?:\.[\w-]+)*)@((?:[\w-]+\.)*\w[\w-]{0,66})\.([a-z]{2,15}(?:\.[a-z]{2})?)$/i;
        return isEmpty(email) || re.test(email);
    };

    const handleSubmit = () => {
        navigate("/");
    };

    return (
        <form method="post" action="//submit.form" onSubmit={validateForm}>
            <div className="container" style={{ maxWidth: '400px' }}>
                <h2 className="pb-3 fs-4">Book a Table at {restaurantName}</h2>
                <div className="pb-3 fs-5">We would be glad to reserve a table for you at our restaurant!</div>
                <div className="pb-3">
                    <label htmlFor="data_3" className="form-label">
                        Name<span style={{ color: 'red' }}> *</span>
                    </label>
                    <input type="text" id="data_3" name="data_3" className="form-control" style={{ maxWidth: '400px' }} />
                </div>
                <div className="pb-3">
                    <label htmlFor="data_4" className="form-label">
                        Phone
                    </label>
                    <input type="text" id="data_4" name="data_4" className="form-control" style={{ maxWidth: '400px' }} />
                </div>
                <div className="pb-3">
                    <label htmlFor="data_5" className="form-label">
                        Email
                    </label>
                    <input type="text" id="data_5" name="data_5" className="form-control" style={{ maxWidth: '400px' }} />
                </div>
                <div className="pb-3">
                    <label htmlFor="data_6" className="form-label">
                        Date<span style={{ color: 'red' }}> *</span>
                    </label>
                    <input type="text" id="data_6" name="data_6" className="form-control" style={{ maxWidth: '250px' }} />
                </div>
                <div className="pb-3">
                    <label htmlFor="data_7" className="form-label">
                        Time<span style={{ color: 'red' }}> *</span>
                    </label>
                    <input type="text" id="data_7" name="data_7" className="form-control" style={{ maxWidth: '250px' }} />
                </div>
                <div className="pb-3">
                    <label htmlFor="data_8" className="form-label">
                        Number of Attendees<span style={{ color: 'red' }}> *</span>
                    </label>
                    <select id="data_8" name="data_8" className="form-select" style={{ maxWidth: '250px' }}>
                        <option>1</option>
                        <option>2</option>
                        <option>3</option>
                        <option>4</option>
                        <option>5</option>
                        <option>6</option>
                        <option>7</option>
                        <option>8</option>
                        <option>9</option>
                        <option>10</option>
                        <option>10+ (Specify in Comments)</option>
                    </select>
                </div>
                <div className="pb-3">
                    <input name="skip_Submit" value="Submit" type="submit" className="btn btn-primary" onClick={handleSubmit} />
                </div>
                <div>
                </div>
            </div>
        </form >
    );
};

export default BookingPage;
